INSERT INTO `arenas` (`id`, `name`, `address`, `city`, `description`, `image_url`, `opening_hours`, `rating`, `reviews_count`, `price_per_hour`, `facilities`, `policies`, `created_at`, `category`, `images`, `status`) VALUES
(1, 'Arena Victory Badminton', 'Jl. Merdeka No.10', 'Surabaya', 'Lapangan badminton indoor berstandar nasional. Lantai kayu, pencahayaan optimal, dan ruang ganti yang bersih. Cocok untuk latihan, komunitas, atau turnamen di pusat kota Surabaya.', NULL, '08:00-22:00', 4.5, 123, 80000, '[\"AC\",\"Parkir\",\"Kantin\",\"Toilet\",\"Locker Room\"]', NULL, '2025-06-12 19:08:55', 'Badminton', '[\"/foto_lapangan.png\",\"/arena-victory-2.jpg\"]', 'maintenance'),
(2, 'Lapangan Bintang Sport', 'Jl. Pahlawan No.22', 'Surabaya', 'Arena badminton dengan fasilitas lengkap di kawasan Pahlawan. Dilengkapi dengan sistem pencahayaan LED dan lantai vinyl berkualitas tinggi.', NULL, '07:00-23:00', 4.2, 87, 75000, '[\"AC\",\"Parkir\",\"Toilet\",\"Sound System\"]', NULL, '2025-06-12 19:08:55', 'Badminton', '[\"/foto_lapangan1.jpg\",\"/bintang-sport-2.jpg\"]', 'active'),
(3, 'ZUPER KEPUTIH', 'Jl. Keputih No.15', 'Surabaya', 'Arena badminton modern di kawasan Keputih dengan konsep sporty dan nyaman. Dekat dengan kampus dan area perumahan.', NULL, '06:00-24:00', 4.7, 156, 70000, '[\"AC\",\"Parkir\",\"Kantin\",\"WiFi\",\"Mushola\"]', NULL, '2025-06-12 19:08:55', 'Badminton', '[\"/foto_lapangan2.jpg\",\"/zuper-keputih-2.jpg\"]', 'active'),
(4, 'ZUPER DHARMAHUSADA', 'Jl. Dharmahusada No.30', 'Surabaya', 'Arena badminton premium di kawasan Dharmahusada dengan standar internasional. Cocok untuk turnamen dan latihan profesional.', NULL, '06:00-23:00', 4.6, 112, 85000, '[\"AC\",\"Parkir Luas\",\"Kantin\",\"Pro Shop\",\"Spectator Area\"]', NULL, '2025-06-12 19:08:55', 'Badminton', '[\"/foto_lapangan3.jpg\",\"/zuper-dharma-2.jpg\"]', 'active'),
(5, 'SportaFit Arena Central Jakarta', 'Jl. Sudirman No. 123, Senayan', 'Jakarta Pusat', 'Arena badminton premium di pusat kota Jakarta dengan fasilitas terlengkap. Dilengkapi dengan AC, sound system, dan pencahayaan LED berkualitas tinggi.', NULL, '06:00-24:00', 4.8, 245, 120000, '[\"AC\",\"Parkir Luas\",\"Kantin\",\"Mushola\",\"Locker Room\",\"Sound System\",\"LED Lighting\"]', NULL, '2025-06-12 19:08:55', 'Badminton', '[\"/arena-central-1.jpg\",\"/arena-central-2.jpg\",\"/arena-central-3.jpg\"]', 'active'),
(6, 'SportaFit Arena Kelapa Gading', 'Jl. Boulevard Raya No. 456, Kelapa Gading', 'Jakarta Utara', 'Arena badminton modern di kawasan Kelapa Gading dengan standar internasional. Cocok untuk turnamen dan latihan profesional.', NULL, '07:00-23:00', 4.6, 198, 100000, '[\"AC\",\"Parkir\",\"Kantin\",\"Mushola\",\"Pro Shop\",\"Spectator Area\"]', NULL, '2025-06-12 19:08:55', 'Badminton', '[\"/arena-gading-1.jpg\",\"/arena-gading-2.jpg\"]', 'active'),
(7, 'SportaFit Arena BSD', 'Jl. BSD Raya No. 789, Serpong', 'Tangerang Selatan', 'Arena badminton terbaru di BSD dengan konsep eco-friendly. Menggunakan teknologi ramah lingkungan dan ventilasi alami.', NULL, '06:00-22:00', 4.7, 167, 90000, '[\"AC\",\"Parkir\",\"Kantin Organic\",\"Mushola\",\"Kids Area\",\"Eco Locker\"]', NULL, '2025-06-12 19:08:55', 'Badminton', '[\"/arena-bsd-1.jpg\",\"/arena-bsd-2.jpg\",\"/arena-bsd-3.jpg\"]', 'active'),
(8, 'Arena Badminton Bandung Premier', 'Jl. Asia Afrika No. 45, Bandung', 'Bandung', 'Arena badminton premium di pusat kota Bandung dengan view pegunungan. Udara sejuk dan fasilitas modern.', NULL, '07:00-22:00', 4.5, 134, 85000, '[\"AC\",\"Parkir\",\"Kantin\",\"Mushola\",\"Mountain View\"]', NULL, '2025-06-12 19:08:55', 'Badminton', '[\"/arena-bandung-1.jpg\",\"/arena-bandung-2.jpg\"]', 'active'),
(9, 'Semarang Sports Center', 'Jl. Pemuda No. 88, Semarang', 'Semarang', 'Pusat olahraga terpadu di Semarang dengan lapangan badminton berstandar nasional. Cocok untuk event besar.', NULL, '06:00-23:00', 4.4, 98, 75000, '[\"AC\",\"Parkir Luas\",\"Kantin\",\"Mushola\",\"Event Hall\"]', NULL, '2025-06-12 19:08:55', 'Badminton', '[\"/arena-semarang-1.jpg\",\"/arena-semarang-2.jpg\"]', 'active'),
(10, 'Yogya Badminton Arena', 'Jl. Malioboro No. 156, Yogyakarta', 'Yogyakarta', 'Arena badminton di jantung kota Yogyakarta dengan nuansa tradisional modern. Dekat dengan pusat wisata.', NULL, '07:00-22:00', 4.6, 189, 70000, '[\"AC\",\"Parkir\",\"Kantin\",\"Mushola\",\"Cultural Touch\"]', NULL, '2025-06-12 19:08:55', 'Badminton', '[\"/arena-yogya-1.jpg\",\"/arena-yogya-2.jpg\"]', 'active');
